import React from "react";
import { BrowserRouter as Router } from "react-router-dom";

import Routes from "./Routes/Rotas";
import history from "./pages/history";

function App() {
  return (
    <Router history={history}>
      <Routes />
    </Router>
  );
}

export default App;
